pragma solidity 0.6.11;

import "../Interfaces/IZKToken.sol";
import "../Interfaces/ICommunityIssuance.sol";
import "../Dependencies/BaseMath.sol";
import "../Dependencies/LiquityMath.sol";
import "../Dependencies/Ownable.sol";
import "../Dependencies/CheckContract.sol";
import "../Dependencies/SafeMath.sol";

contract CommunityIssuance is
    ICommunityIssuance,
    Ownable,
    CheckContract,
    BaseMath
{
    using SafeMath for uint;

    // --- Data ---

    string public constant NAME = "CommunityIssuance";

    uint public constant SECONDS_IN_ONE_MINUTE = 60;

    /* The issuance factor F determines the curvature of the issuance curve.
     *
     * Minutes in one year: 60*24*365 = 525600
     *
     * For 50% of remaining tokens issued each year, with minutes as time units, we have:
     *
     * F ** 525600 = 0.5
     *
     * Re-arranging:
     *
     * 525600 * ln(F) = ln(0.5)
     * F = 0.5 ** (1/525600)
     * F = 0.999998681227695000
     */
    uint public constant ISSUANCE_FACTOR = 999998681227695000;

    /*
     * The community ZKT supply cap is the starting balance of the Community Issuance contract.
     * It should be minted to this contract by ZKToken, when the token is deployed.
     *
     * Set to 32M (slightly less than 1/3) of total ZKT supply.
     */
    uint public constant ZKTSupplyCap = 32e24; // 32 million

    IZKToken public zkToken;

    address public stabilityPoolAddress;

    uint public totalZKTIssued;
    uint public immutable deploymentTime;
    mapping(address => uint) public balances;

    // --- Events ---

    event ZKTokenAddressSet(address _zkTokenAddress);
    event StabilityPoolAddressSet(address _stabilityPoolAddress);
    event TotalZKTIssuedUpdated(uint _totalZKTIssued);

    // --- Functions ---

    constructor() public {
        deploymentTime = block.timestamp;
    }

    function setAddresses(
        address _zkTokenAddress,
        address _stabilityPoolAddress
    ) external override onlyOwner {
        checkContract(_zkTokenAddress);
        checkContract(_stabilityPoolAddress);

        zkToken = IZKToken(_zkTokenAddress);
        stabilityPoolAddress = _stabilityPoolAddress;

        // When ZKToken deployed, it should have transferred CommunityIssuance's ZKT entitlement
        uint ZKTBalance = zkToken.balanceOf(address(this));
        assert(ZKTBalance >= ZKTSupplyCap);

        emit ZKTokenAddressSet(_zkTokenAddress);
        emit StabilityPoolAddressSet(_stabilityPoolAddress);
    }

    function issueZKT() external override returns (uint) {
        _requireCallerIsStabilityPool();

        uint latestTotalZKTIssued = ZKTSupplyCap
            .mul(_getCumulativeIssuanceFraction())
            .div(DECIMAL_PRECISION);
        uint issuance = latestTotalZKTIssued.sub(totalZKTIssued);

        totalZKTIssued = latestTotalZKTIssued;
        emit TotalZKTIssuedUpdated(latestTotalZKTIssued);

        return issuance;
    }

    /* Gets 1-f^t    where: f < 1

    f: issuance factor that determines the shape of the curve
    t:  time passed since last ZKT issuance event  */
    function _getCumulativeIssuanceFraction() internal view returns (uint) {
        // Get the time passed since deployment
        uint timePassedInMinutes = block.timestamp.sub(deploymentTime).div(
            SECONDS_IN_ONE_MINUTE
        );

        // f^t
        uint power = LiquityMath._decPow(ISSUANCE_FACTOR, timePassedInMinutes);

        //  (1 - f^t)
        uint cumulativeIssuanceFraction = (uint(DECIMAL_PRECISION).sub(power));
        assert(cumulativeIssuanceFraction <= DECIMAL_PRECISION); // must be in range [0,1]

        return cumulativeIssuanceFraction;
    }

    function sendZKT(address _account, uint _ZKTamount) external override {
        _requireCallerIsStabilityPool();

        // not transfer but save a record
        // zkToken.transfer(_account, _ZKTamount);
        balances[_account] = balances[_account].add(_ZKTamount);
    }

    function removeZKT(uint _ZKTamount) external onlyOwner {
        uint ZKTBalance = zkToken.balanceOf(address(this));
        require(
            _ZKTamount <= ZKTBalance,
            "CommunityIssuance: Insufficient zkToken"
        );
        zkToken.transfer(msg.sender, _ZKTamount);
    }

    // --- 'require' functions ---

    function _requireCallerIsStabilityPool() internal view {
        require(
            msg.sender == stabilityPoolAddress,
            "CommunityIssuance: caller is not SP"
        );
    }
}
